import React from 'react';

const FetchButton = ({ next, currentPokemons, setPokemonsArr }) => {
    const fetchNext = () => {
        fetch(next)
            .then(res => setPokemonsArr())
    }

    return (
        <div className="fetch-btn-container">
            <button>Display More</button>
        </div>
    )
}

export default FetchButton;
